import { useState } from "react";

const Cell = () => {
  let styles = {};

  const [power, setPower] = useState(0);

  const classes = ["cell"];

  if (power) [classes.push("on")];

  const handleClick = () => {
    setPower(1);
  };

  return (
    <div
      className={classes.join(" ")}
      style={styles}
      onClick={handleClick}
    ></div>
  );
};
